import React from 'react';
import './App.css';
import { Cards } from './Cards';

import { Container } from 'react-bootstrap';
import 'react-bootstrap';

export const Home = () => {
  return (
    <div className="App-main">
      <Container>
        <p>This is home</p>
        <Cards name="Palace" loc="Clare"/>
        <Cards name="Dicies" loc="Dublin"/>
      </Container>
    </div>
  );
}


